// src/pages/Upload1.jsx
import React from "react";
// 컴파일러 오류 메시지에 따라 import 경로를 소문자로 수정합니다.
import Header from "../components/Header";
import { FilterIcon, PlusIcon } from "../components/IconSet";

export default function Upload() {
  return (
    <div className="w-full min-h-screen bg-white">
      {/* 1. 고정 헤더 */}
      <Header />

      {/* 2. 메인 컨텐츠 영역 (헤더 높이만큼 패딩) */}
      {/* 헤더 높이를 72px로 가정하고 pt-24 (96px) 정도로 조정 */}
      <main className="w-full max-w-5xl mx-auto pt-24 pb-12 px-8">
        <div className="flex flex-col gap-6">
          
          {/* 3. 파일 업로드 드롭존 */}
          <div className="w-full h-80 bg-[#DEF5EF]/50 rounded-xl border border-gray-200
                          flex flex-col justify-center items-center gap-4">
            
            {/* 파일 업로드 버튼 */}
            <button className="flex items-center gap-2 px-6 py-3 bg-white rounded-lg border border-gray-300
                               text-gray-700 font-semibold hover:bg-gray-50 transition-colors">
              {/* IconSet에서 가져온 컴포넌트 */}
              <PlusIcon className="w-5 h-5 text-gray-700" /> 
              <span>파일 업로드</span>
            </button>
            <p className="text-gray-500">또는 마우스로 드래그하기</p>
          </div>

          {/* 4. 필터 및 분석 버튼 영역 */}
          <div className="w-full flex items-center gap-4">
            {/* 지정된 필터 목록 (D9D9D9 색상 적용) */}
            <div className="flex-grow h-16 bg-[#D9D9D9]/50 rounded-lg
                            flex items-center px-6">
              <span className="text-gray-600">지정된 필터 목록 표시</span>
            </div>
            
            {/* 필터 아이콘 버튼 */}
            <button className="h-16 w-16 flex justify-center items-center bg-[#D9D9D9]/50 rounded-lg
                               text-gray-600 hover:bg-[#D9D9D9]/80 transition-colors">
              {/* IconSet에서 가져온 컴포넌트 */}
              <FilterIcon className="w-5 h-5 text-gray-600" />
              <span>필터</span>
            </button>
          </div>

          {/* 5. 분석 시작하기 버튼 (1AC0A4 색상 적용) */}
          <button className="w-full h-16 bg-[#1AC0A4] text-white text-lg font-bold rounded-lg
                             hover:bg-[#169a83] transition-colors">
            분석 시작하기
          </button>

        </div>
      </main>
    </div>
  );
}
